INSERT INTO `movies` (`movie_id`, `movie_title`, `movie_description`, `movie_poster`) VALUES
(1, 'The Northman', 'In AD 895, King Aurvandill returns to the fictional island of Hrafnsey after his overseas conquests, reuniting with his wife, Queen Gudrún, and his heir, Prince Amleth. To prepare Amleth for his eventual ascension, the father and son participate in a ceremony overseen by Aurvandill\'s jester, Heimir. Heimir tells Amleth that his destiny is fixed and cannot be escaped, and Amleth vows to avenge his father if Aurvandill is ever slain, rather than live his life in shame. The next morning, Amleth\'s bastard uncle Fjölnir stages a palace coup, personally beheads Aurvandill, sacks the hillfort and carries away Gudrún. Amleth narrowly escapes Fjölnir\'s assassins and flees by boat, swearing vengeance.\r\n\r\nYears later, an adult Amleth is an ulfheðnar with a band of Vikings. After attacking a village in Gardariki, Amleth encounters a Seeress in the temple of Svetovit; the Seeress says that it is Odin\'s will for Amleth to take his revenge on Fjölnir and advises Amleth to \"follow the vixen\'s tail,\" and that his fate is intertwined with that of a Maiden-King. Soon after, Amleth learns that \"Fjölnir the Brotherless\" has lost his throne to King Harald Fairhair of Norway and now lives as a sheep farmer in Iceland. Cutting his hair and posing as a slave, Amleth sneaks aboard a ship. He encounters an enslaved Slavic woman named Olga, who claims to be a sorceress. They are taken to Fjölnir\'s farm, where Amleth learns his mother has married Fjölnir and borne him a son named Gunnar.\r\n\r\n', );
INSERT INTO `movies` (`movie_id`, `movie_title`, `movie_description`, `movie_poster`) VALUES
(2, 'Dunkirk', 'In 1940, during the Battle of France, Allied soldiers have retreated to Dunkirk. Tommy Jensen, a young British private, is the sole survivor of a German ambush. At the beach, he finds thousands of troops awaiting evacuation and meets Gibson, an aloof soldier who is burying a body. After a Luftwaffe dive bomber attack, they attempt to get aboard a hospital ship but are ordered off. The ship is sunk by dive bombers; Tommy saves Alex, another soldier.\r\n\r\nWith a single, vulnerable mole available for embarking on deep-draft ships, the Royal Navy requisitions civilian vessels in Great Britain that can get to the beach. In Weymouth, a civilian sailor Dawson, with his son Peter, sets out on his boat Moonstone, rather than let the Navy commandeer her. Their teenage hand George impulsively joins them. At sea, they rescue a shivering shell-shocked soldier from a wrecked ship. When he realises that Dawson is sailing for Dunkirk, the soldier demands that they turn back and tries to wrest control of the boat; in the scuffle, George suffers a head injury that renders him blind. Elsewhere, three Spitfires, tasked with defending the evacuation, cross the English Channel. After their leader is shot down in a dogfight, one of the pilots, Farrier, assumes command, but the other Spitfire is hit and ditches. Its pilot, Collins, is rescued by Moonstone.', );

